import React from 'react';

// STYLE
import styled, { css } from 'styled-components';
import { borderBox } from '../shared/style';

// ELEMENTS
import { Grid } from '../elements/index';

// COMPONENTS
import CommnunityPostList from '../components/CommunityPostList';

const CommunityDetail = () => {
  return (
    <>
    <Grid bgColor="bgColor" height="80vh">
        <Grid 
          width="100%" 
          height="auto" 
          addstyle={() => {
          return css`
            margin: 105px 0 -80px 200px;
            font-size: 18px;
            font-weight: bold;
            overflow:hidden;
          `;
         }}
        > 
        평창동 동네 모임
        </Grid>
      <CommunityDetailStyle>

         <Grid margin="30px 0 0 0">
        <CommnunityPostList/>
        </Grid>
      </CommunityDetailStyle>
    </Grid>
    </>
  );
};


const CommunityDetailStyle = styled.div`
  border: 2px solid rgb(${(props) => props.theme.palette.olive});
  width: 375px;
  height: 70vh;
  margin: 10vh auto;
  border-radius: 30px;
  overflow-y:scroll;
  overflow-x:hidden;
`;

export default CommunityDetail;
